tinymce.PluginManager.add("humhubtrigger",(function(t,e){const n=t.getParam("humhubTrigger");t.ui.registry.addButton("humhubtrigger",{icon:n.icon,text:n.text,onAction:function(){n.selector&&$(n.selector).length&&$(n.selector).trigger(n.event)}})}));
